import React from 'react';
import styles from './Navbar.module.css';

const Navbar: React.FC = () => (
  <nav className={styles.navbar}>
    {/* Logo Section - Left Side */}
    <div className={styles.logoSection}>
      <img src="/for-a-cure-logo.svg" alt="For A Cure Foundation Logo" className={styles.logo} />
      <span className={styles.brandName}>FOR A CURE</span>
    </div>
    
    {/* Navigation Links - Right of Logo with Increased Spacing */}
    <div className={styles.navigationLinks}>
      <span className={styles.navLink}>Home</span>
      <span className={styles.navLink}>About Us</span>
      <span className={styles.navLink}>Research</span>
      <span className={styles.navLink}>Get Involved</span>
      <span className={styles.navLink}>News</span>
      <span className={styles.navLink}>Contact</span>
    </div>
    
    {/* Action Buttons - Right Side */}
    <div className={styles.actionButtons}>
      <button className={styles.donateButton}>
        Donate
      </button>
      <button className={styles.memberButton}>
        Be a Member
      </button>
    </div>
  </nav>
);

export default Navbar;
